import React from 'react';
import SlotM from './SlotM';



const App = ()=>{
   return(
     <>
     <h1 style={{marginBottom:'2rem'}} className="heading_style">Welocome to <span style={{fontWeight:'bold',backgroundColor:' rgb(192, 190, 190)',color:'#000',fontWeight:'400',fontSize:'2rem'}}>Slot machine game</span></h1>
     <div className="slot__inner">
     <SlotM x=":smile" y=":smile" z=":smile" />
     <hr />
     <SlotM x=":smile" y=":smile" z=":smile" />
     <hr />
     <SlotM x=":smile" y=":smile" z=":smile" />
     <hr />
     </div>
     </>
   )
}

export default App;
